import './jadwal.css'

import { NonH2H } from '../index'

const SeniJadwal = ({ jadwalData }) => {
  return (
    <div className='spirit__content section__padding'>
        <div className="spirit__heading">
          <h1>JADWAL</h1>
        </div>

        {
            Object.entries(jadwalData
                .sort((a, b) => (
                    a.time.localeCompare(b.time)
                ))
                .reduce((prev, curr) => {

                }))
        }
        <div className='spirit__jadwal-date'>
            <h2>Senin, 27 November 2022</h2>
            <div className='spirit__jadwal-content'>
                <div className='spirit__jadwal-time'>
                    <h1>17:00</h1>
                </div>
                <div className="spirit__jadwal-container">
                    {/* {jadwalData.map((item, index) => (
                        <NonH2H data={item}/>
                    ))} */}
                </div>
            </div>
        </div>
    </div>
  )
}

export default SeniJadwal
